const express = require('express');
const cors = require('cors');
const app = express();
const PORT = 8080;
const path = require('path');


app.use(express.static(path.join(__dirname, 'public')));

// Middleware
app.use(cors());
app.use(express.json());

// Mock Data
const data = {
  professionalName: "Teirza Tippets",
  base64Image: "",
  nameLink: { firstName: "Teirza", url: "https://example.com" },
  primaryDescription: "Current student of BYU-Idaho.",
  workDescription1: "Senior year of the Web Design and Development Program.",
  workDescription2: "Certified and Licensed Pharmacy Technician since 2020.",
  linkTitleText: "Explore my work and connect with me:",
  linkedInLink: { text: "LinkedIn Profile", link: "https://www.linkedin.com/in/teirza-tippets-1a46b7261/" },
  githubLink: { text: "GitHub Repos", link: "https://github.com/Teirza-Tippets" },
};

// REST Endpoint
app.get('/professional', (req, res) => {
  res.json(data);
});

// Start the Server
app.listen(PORT, () => {
  console.log(`Server running at http://localhost:${PORT}`);
});
